@TapiaTury @Foro_TV Se culpa a los automovilistas porque tienen la culpa.

"Los ciclistas se pasan los altos"
Sorpresa, nos podemos pasar el alto de acuerdo al art 16 del reglamento de tránsito. Nadie el reglamento antes de manejar, pobres víctimas a las que siempre se les culpa.

